import React, { Component } from "react";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      status: false
    };
  }

  handleStartGame = () =>
    this.setState({status: true});

  renderFirstPage = () =>
    <div>
      <div>N-PUZZLE</div>
      <div>Venha se divertir</div>
      <div>
        <button>Começar</button>
        <button>Configurações</button>
      </div>
    </div>;

  render() {
    return this.renderFirstPage();
  }
}

export default App;
